private static <V, E> V initialize(DirectedGraph<V, E> dg, Queue<V> queue, Map<V, ModifiableInteger> inDegreeMap){
    for (Iterator<V> i = dg.vertexSet().iterator(); i.hasNext(); ) {
        V vertex = i.next();
        int inDegree = dg.inDegreeOf(vertex);
        inDegreeMap.put(vertex, new ModifiableInteger(inDegree));
        if (inDegree == 0) {
            queue.offer(vertex);
        }
    }
    if (queue.isEmpty()) {
        return null;
    } else {
        return queue.peek();
    }
}

